export const MainMenu = () => {

    let dayInfo = new Date();

    setTimeout(() => dayInfo = new Date(), 10000);

    return <ul>
        <li>{dayInfo.toDateString()}</li>
        <li>Time</li>
        <li>Projects</li>
        <li>Reports</li>
    </ul>
}
